import React from 'react';

class Referral extends React.Component() {
    render(){
      return (
        <BrowserRouter>
          <Switch>     
            <Route to="/" Component={Referral}></Route>
          </Switch>
        </BrowserRouter>
   
      );
    }
  }
  

export default Referral
